import styled from "styled-components";

const Wrapper = styled.div`
  background: red;
  text-align: center;
  margin: 0 auto;
  height: 100vh;
`;

const Index = () => {
  return (
    <>
      <Wrapper>
        <span>HOLA</span>
      </Wrapper>

      <style>
        {`
          body{
            margin: 0;
          }
        `}
      </style>
    </>
  );
};

export default Index;
